        "Descrizione_marketing": "Lampada a sospensione in alluminio estruso disponibile in diametro 22mm/32mm e rispettive lunghezze 850mm/650mm. Lampada a sospensione e plafone alluminio estruso con diametro 55mm e lunghezza 450mm. La versione con diametro 55mm prevede la possibilità di installare tre ottiche con fascio 25°, 34°,48°. Sorgente luminosa composta da modulo LED ad elevate prestazioni CRI>90 2700K. Rosone con driver ON/OFF integrato nella versione diametro 22mm. Driver ON/OFF integrato nel cilindro nella versione 32mm e 55mm. Finitura con vernice poliacrilica in nero gommato o bianco o finitura in foglia oro decorata a mano. Cavo elettrico trasparente ultrasottile. Ideale per ristoranti, zone living, camere da letto o per creare grandi composizioni a cascata.",
        "Descrizione_Tecnica_IT": "Apparecchio di illuminazione per installazione a sospensione in ambienti interni, con emissione diretta. Struttura in alluminio estruso con verniciatura poliacrilica in colore bianco opaco o nero gommato oppure con rivestimento in foglia oro. Staffe di supporto cablaggio in lamiera decapata con verniciatura poliacrilica. Dissipatore in alluminio estruso anodizzato. Riflettore in materiale termoplastico con finitura cromata. Schermo in policarbonato trasparente. Testata di chiusura in lamiera decapata con verniciatura poliacrilica. Cavo di alimentazione e sospensione in PVC trasparente di lunghezza 2m (78,7\"). Rosone di alimentazione con staffa di fissaggio a soffitto in lamiera decapata e involucro in alluminio estruso con verniciatura poliacrilica in colore bianco opaco o nero gommato oppure con rivestimento in foglia oro.",
